import React, {Component} from 'react';
import axios from 'axios';
import { Jumbotron, Col, Card, CardTitle, CardText } from 'reactstrap';
import {registerUser} from './userfunctions'

export default class Userregisteration extends Component {
    constructor(props) {
        super(props);

        this.onChangeFullName = this.onChangeFullName.bind(this);
        this.onChangeCity = this.onChangeCity.bind(this);
        this.onChangeCountry = this.onChangeCountry.bind(this);
        this.onChangeID = this.onChangeID.bind(this);
        this.onChangeKey = this.onChangeKey.bind(this);

        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            FullName: '',
            City: '',
            Country: '',
            ID: '',
            Key:''
        }
    }

    onChangeID(e) {
        this.setState({
            ID: e.target.value
        });
    }

    onChangeKey(e) {
        this.setState({
            Key: e.target.value
        });
    }

    onChangeFullName(e) {
        this.setState({
            FullName: e.target.value
        });
    }

    onChangeCity(e) {
        this.setState({
            City: e.target.value
        });
    }

    onChangeCountry(e) {
        this.setState({
            Country: e.target.value
        });
    }

    onSubmit(e) {
        e.preventDefault();

        console.log(`Form submitted:`);
        console.log(`Todo Description: ${this.state.FullName}`);
        console.log(`Todo Responsible: ${this.state.City}`);
        console.log(`Todo Priority: ${this.state.Country}`);
        console.log(`Todo Completed: ${this.state.ID}`);
        console.log(`Todo Completed: ${this.state.Key}`);

        const newUser = {
            FullName: this.state.FullName,
            City: this.state.City,
            Country: this.state.Country,
            ID: this.state.ID,
            Key: this.state.Key
        }

        registerUser(newUser).then(res => {
            console.log("Heres")
            this.props.history.push(`/userlogin`)
          })
    }

    render() {
        return (
            <div class='container'>
                <Jumbotron>
                    <h1 className="display-3">User Registration</h1>
                        <p className="lead">Provides below information to be registered yourself.</p>
                        <hr className="my-2" />
                        <p className="lead">
                        </p>
                    </Jumbotron>
                    <Col sm='12'>
                        <Card body>
                            <CardTitle><b><h3>Provides below information</h3></b></CardTitle>
                                <CardText> 
                                <form onSubmit={this.onSubmit}>
                                    <div className="form-group">
                                        <label>Full Name:</label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.FullName}
                                                onChange={this.onChangeFullName}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>City:</label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.City}
                                                onChange={this.onChangeCity}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>Country: </label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.Country}
                                                onChange={this.onChangeCountry}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>ID:</label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.ID}
                                                onChange={this.onChangeID}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>Key: </label>
                                        <input  type="Password"
                                                className="form-control"
                                                value={this.state.Key}
                                                onChange={this.onChangeKey}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <button type="submit" value="Register" className="btn btn-primary">Register</button>
                                    </div>
                                </form>
                                </CardText>
                        </Card>                        
                    </Col>
            </div>
        )
    }
}
